==Trivia==
* The Dagannoth Supreme's examine text references an entity called the [[Bukalla]]. This entity was originally planned to be a tribe of vikings that the Supreme had conquered,{{CiteReddit|author=Mod James|url=https://www.reddit.com/r/2007scape/comments/4hha91/i_used_to_work_on_rs_ask_me_selected_things/d2pqszd/|title=I used to work on RS, Ask Me Selected Things?|quote=This is another example of me dropping something I could come back to later on - I had no specific plans, but I was more leaning towards it being a 'lost tribe' of vikings than an individual. Obviously someone else went somewhere else with that though XD|date=3 May 2016|archiveurl=http://archive.is/38sui|archivedate=6 October 2018|notes=}} but the Bukalla eventually turned out to be a legendary [[Fremennik]] warrior.

